            print('aca se procesa el archivo')

            fname = 'clock_file.xls'
            print(fname)
            filecontent = base64.b64decode(self.clock_file)

            f = open(fname,'w')
            f.write(filecontent)
            f.close()

            # open file
            xl_workbook = xlrd.open_workbook(fname, encoding_override='cp1252')
